import { Route, Redirect } from "react-router-dom";

const PrivateRoute = (Component) => {
  debugger;
  return (
    <Route
      render={(props) =>
        isLogin() ? <Component {...props} /> : <Redirect to="/signin" />
      }
    />
  );
};

export default PrivateRoute;
